import React from 'react';
import './skills.css';

const Skills = () => {
  return (
    <section id='skills'>
      <span className="skillTitle"> About Me </span>
      <span className="skillDesc"> Dedicated IT professional that is mainly seeking a position as a software developer with a focus in ServiceNow development and ITSM while being open to other positions for learning experiences. Ambitious and eager to contribute to application development and implement customer solutions. Works well within an agile team and understands oneâ€™s responsibility in their respective role. Self-motivated and able to continuously gain new knowledge on the latest best practices, technologies, and tools to ensure that the customer is satisfied and to remain a competitive resource. </span>
      <div className="skillBar">
        <div className="skillBarText">
          <h1> JavaScript, CSS, HTML, Java, C, Python, XML, JSON, IntelliJ, Eclipse, Visual Studio Code, Visual Studio, Microsoft Office (Word, Excel, PowerPoint, Outlook, Teams), Slack, Linear Gitflow Agile Process, Photoshop, Heroku: Cloud Application Platform, React, NextJS, GitHub, GitLab, REST webservices, AJAX </h1>
        </div>
      </div>
    </section>

  );
}

export default Skills;
